import './App.css';
import React from "react";
import Nav from "./components/Navigation/nav";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Nav />
          <Routes>
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
